function resetContract() public {
    require(msg.sender == admin, "Only admin can call this function");

    // Resetting state variables
    totalEntries = 0;
    ticketCost = 0;
    tokenId = 0;
    nftContract = address(0);
    lotteryStatus = false;

    // Clear players array
    delete players;

    // Clear entry counts mapping
    for (uint256 i = 0; i < players.length; i++) {
        entryCounts[players[i]] = 0;
    }

    // Emit an event to indicate the contract has been reset
    emit LotteryEnded();
}

